window.bookSummaryJSON = "<p><b>2018 Axiom Business Book Award Winner, Gold Medal </b></p> <p><b>Amazon Best Seller in Sales and Selling and Consumer Behavior </b></p> <p>Stop Selling! Start Solving! </p> <p>In <i>Ninja Selling</i>, author Larry Kendall transforms the way listeners think about selling. He points out the problems with traditional selling methods and instead offers a science-based selling system that gives predictable results regardless of personality type. <i>Ninja Selling</i> teaches listeners how to shift their approach from chasing clients to attracting clients. Listeners will learn how to stop selling and start solving by asking the right questions and listening to their clients. </p> <p><i>Ninja Selling </i>is an invaluable step-by-step guide that shows listeners how to be more effective in their sales careers and increase their income-per-hour, so that they can lead full lives. <i>Ninja Selling </i>is both a sales platform and a path to personal mastery and life purpose. Followers of the Ninja Selling system say it not only improved their business and their client relationships; it also improved the quality of their lives.</p>"; 
